"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-size:11px;\">Kings Head Inn:</span><br />\n<span style=\"font-size:11px;\">This pub was established in around 1840 and closed in 1914 \u2013 it is now demolished.</span>\n</p>\n</div>\n</div>",
