"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nGorringe Terrace (Number 2) Grocers Shop, run by William Stookley Cheeseman\n</p>\n<p>\nLocating this address and shop was proving to be difficult as the numbering of some properties in London Road have changed since William Stookley Cheeseman ran his grocer shop.\n</p>\n<p>\nHaving contacted Mitcham Library it appears that Gorringe Terrace was actually Gorringe Park Terrace and Gorringe Park Terrace is now 23 \u2013 29 London Road, Mitcham.\n</p>\n<p>\nIf you are interested to learn more, read on....\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nDear Bryan,\n</p>\n<p>\nRe: Your recent enquiry.\n</p>\n<p>\n \n</p>\n<p>\nMy colleague has now run some extensive checks through our collection of maps and trade directories for information on Gorringe Terrace. We suspect that Gorringe Terrace was actually Gorringe Park Terrace.\n</p>\n<p>\nThe 1892 and 1909/10 Kelly\u2019s directories do not show any street / housing parade of the former name.\n</p>\n<p>\n \n</p>\n<p>\nGorringe Park Terrace was a group of four properties, each listed as a shop or hotel:\n</p>\n<p>\n \n</p>\n<p>\n1892: Gorringe Park Terrace ( from Tooting Junction Railway Bridge to Figges Marsh )\n</p>\n<p>\nWest Side:\n</p>\n<p>\nGorringe Park Terrace\n</p>\n<p>\n1: Smith, C A  - Cycle maker\n</p>\n<p>\n2: White, W \u2013 Coffee House ( In 1891, this was Francis Gale\u2019s grovery shop. )\n</p>\n<p>\n4: Gorringe Park Hotel \u2013 run by Robert Turner\n</p>\n<p>\n \n</p>\n<p>\n1909/10:\n</p>\n<p>\nGorringe Park Parade &amp; terrace\n</p>\n<p>\n1: Davis, Arthur \u2013 cycle maker\n</p>\n<p>\n2: Crocker, Frank William \u2013 confectioner, newsagent. Tobacconist &amp; co\n</p>\n<p>\n3: Curtis, Charles Nash \u2013 Plumber &amp; gasfitter\n</p>\n<p>\n4; Gorringe Park Hotel \u2013 Arthur Crisp.  \n</p>\n<p>\n \n</p>\n<p>\nI have attached a scanned version of this, in case you are also interested in Gorringe Park Parade. If you can provide your great grandfather\u2019s name, we may be able to check for this amongst our directory entries.\n</p>\n<p>\n \n</p>\n<p>\nGorringe Park Terrace is now 23 \u2013 29 London Road, Mitcham. The terrace itself still exists and looks much as it would have done in 1901. See:\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"http://www.streetmap.co.uk/map.srf?x=527932&amp;y=170553&amp;z=110&amp;sv=527932,170553&amp;st=4&amp;ar=y&amp;mapp=map.srf&amp;searchp=ids.srf&amp;dn=712&amp;ax=527932&amp;ay=170553&amp;lm=0\">http://www.streetmap.co.uk/map.srf?x=527932&amp;y=170553&amp;z=110&amp;sv=527932,170553&amp;st=4&amp;ar=y&amp;mapp=map.srf&amp;searchp=ids.srf&amp;dn=712&amp;ax=527932&amp;ay=170553&amp;lm=0</a>\n</p>\n<p>\n( Arrow marks approximate site of the terrace. )\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"https://www.google.com/maps/@51.419715,-0.1617235,3a,90y,124.97h,95.77t/data=!3m6!1e1!3m4!1sC2C7KyQRy9OOr_93mjt7Jw!2e0!7i16384!8i8192\">https://www.google.com/maps/@51.419715,-0.1617235,3a,90y,124.97h,95.77t/data=!3m6!1e1!3m4!1sC2C7KyQRy9OOr_93mjt7Jw!2e0!7i16384!8i8192</a>\n</p>\n<p>\n \n</p>\n<p>\nTo give you a more contemporary image, closer to your research period \u2013 see this photos of the Gorringe Park Hotel, at No. 4 Gorringe Park Terrace ( 1920s and 1970s )\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"https://photoarchive.merton.gov.uk/collections/buildings/51096-albion-outing-from-the-gorringe-park-hotel-church-road?\">https://photoarchive.merton.gov.uk/collections/buildings/51096-albion-outing-from-the-gorringe-park-hotel-church-road?</a>\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"https://photoarchive.merton.gov.uk/collections/buildings/29196-gorringe-park-hotel-mitcham?\">https://photoarchive.merton.gov.uk/collections/buildings/29196-gorringe-park-hotel-mitcham?</a>\n</p>\n<p>\n \n</p>\n<p>\nIf you can let us have your great grandfather\u2019s name, we may be able to pinpoint his home from our trade directories and electoral registers.\n</p>\n<p>\n \n</p>\n<p>\nI hope this email proves helpful. Should you need any further assistance, please feel free to contact me.\n</p>\n<p>\n \n</p>\n<p>\nRegards,\n</p>\n<p>\nSarah Gould\n</p>\n<p>\nService Manager ( Heritage &amp; Local Studies )\n</p>\n<p>\nCommunity &amp; Housing\n</p>\n<p>\n020 8545 3239\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\nFrom: Bryan <br />\nSent: 27 May 2019 17:30<br />\nTo: Mitcham Library &lt;MitchamLibrary@merton.gov.uk&gt;<br />\nSubject: Gorringe Terrace and its location\n</p>\n<p>\n \n</p>\n<p>\nHi,<br />\nPlease can you help.\n</p>\n<p>\nI am trying to locate 'Gorringe Terrace'.\n</p>\n<p>\nI have found some text giving reference to Gorringe Terrace and it's location in the archives of the mitcham history notes web site (and i include links to them bellow), but having also studied historical and Goggle maps following the London Road from Tooting to Mitcham, i still can not locate 'Gorringe Terrace'.\n</p>\n<p>\nThe 1901 England, Wales &amp; Scotland Census (via find-my-past web site) tells me that my great grandfather did reside at Gorringe Terrace - I reside on the South Coast.\n</p>\n<p>\nI would be immensely grateful for any help that could help me discover where Gorringe Terrace is... Can you help?\n</p>\n<p>\nOnce again i hope you can help.\n</p>\n<p>\nThank you,<br />\nBryan\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n[Links]<br />\nMitcham history notes web site:<br />\nGORRINGE PARK TERRACE - now included in London Road<br />\n<a href=\"https://mitchamhistorynotes.com/tag/1925/page/4/#G\">https://mitchamhistorynotes.com/tag/1925/page/4/#G</a>\n</p>\n<p>\n1911-commercial-directory<br />\nEdwards Alfred, tobacconist, 2 Gorringe Park terrace, London road<br />\nGodfrey Herbert J., estate agts. 2 Gorringe Park terrace, London road<br />\n<a href=\"https://mitchamhistorynotes.com/2016/09/16/1911-commercial-directory/\">https://mitchamhistorynotes.com/2016/09/16/1911-commercial-directory/</a>\n</p>\n<p>\nMaps:<br />\nSurrey VII.16 (Mitcham; Wandsworth Borough)<br />\nRevised-1911_Published-1913<br />\n<a href=\"https://maps.nls.uk/view/103313863#zoom=2&amp;lat=7967&amp;lon=9505&amp;layers=BT\">https://maps.nls.uk/view/103313863#zoom=2&amp;lat=7967&amp;lon=9505&amp;layers=BT</a>\n</p>\n<p>\nSurrey VII.16 Mitcham_Wandsworth Borough_Revised-1934_Published-1935<br />\n<a href=\"https://maps.nls.uk/view/103313860\">https://maps.nls.uk/view/103313860</a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&gt; postmaster@merton.gov.uk<br />\n&gt; http://www.merton.gov.uk\n</p>\n</div>\n</div>",
