"<div>\n<i class=\"NoteType\">\nEvent Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nHenry Leslie Cheeseman:\n</p>\n<p>\nHe was employed as an 'Office Boy' by the firm John Hollingsworth (Auctioneer, Surveyor and Estate Agent) but he would also be required to cycle the area of Fulham and Walham Green to collect rent.  After WW1 he returned to working for John Hollingsworth and would then go on to become a partner in the firm until he retired and held his last auction at the age of 82 years.\n</p>\n</div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n29 Effie Road is where Henry Leslie Cheesman worked for much of his life as an <a href=\"search.html\">Office Boy and Auctioneer, Surveyor and Estate Agent</a>. As at today's date (March, year 2020) the building is occupied by estate agent Broadway Chambers, 29 Effie Rd, Fulham, London SW6 1EN\n</p>\n</div>\n</div>",
