"<div>\n<i class=\"NoteType\">\nHtml code\n</i>\n<div class=\"grampsstylednote\">\n<strong>King's College School</strong>, commonly referred to as <strong>KCS</strong>, King's or KCS Wimbledon, is a selective independent school in Wimbledon, southwest London, England. The school was founded in 1829 as the junior department of King's College London and had part of the school\u2019s premises in Strand, prior to relocating to Wimbledon in 1897.<br/><iframe src=\"https://www.google.com/maps/embed?pb=!4v1589751620495!6m8!1m7!1sEdCjnnA1FDt2MaPfGudfoA!2m2!1d51.4216364345824!2d-0.2266251446650424!3f114.50336409105053!4f-0.4887877843935229!5f1.9587109090973311\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>\n</div>\n</div>",
