"<div>\n<i class=\"NoteType\">\nAssociation Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMargaret, Known as Mrs Flood was employed to help Laurie with family tasks around the home, (Mill House, Bollin Grove, Prestbury) which for instance would include making breakfast for Laurie's father (Henry) while Laurie took the kids to school, she would also tidy up the kitchen, do occasional ironing and baby sitting.\n</p>\n</div>\n<i class=\"NoteType\">\nAssociation Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nNellie was employed to help Laurie with house work at (Mill House, Bollin Grove, Prestbury). She was very helpful with Laurie's father and had a very friendly nature about her and good with the kids.\n</p>\n</div>\n<i class=\"NoteType\">\nHtml code\n</i>\n<div class=\"grampsstylednote\">\n<iframe src=\"https://www.google.com/maps/embed?pb=!4v1589196962634!6m8!1m7!1s-LYkKBGsO8hB6PCq-g5OQw!2m2!1d53.29345285354197!2d-2.152019448208008!3f270!4f0!5f0.7820865974627469\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>\n</div>\n</div>",
