"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong>South Kensington Railway Station</strong> - According to Laura Perry nee Cheeseman, a <strong>Lloyds Bank</strong> branch was near to the railway station and was where Ian Perry worked around the 1950's.&lt;br/&gt; <br />\n&lt;iframe src=\"https://www.google.com/maps/embed?pb=!4v1589234636096!6m8!1m7!1sZfno8J4lqTZ3j58rL43qNQ!2m2!1d51.49438732442925!2d-0.1743359367178127!3f124.96611338101012!4f-1.3535173411781614!5f1.9587109090973311\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"&gt;&lt;/iframe&gt;\n</p>\n</div>\n</div>",
