"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-size:14px;\">Thetford Lodge, 16 Thetford Road, New Malden, is at the time of writing (May 2019) a Care Home (Assisted living facility). However it used to be occupied by Herbert and Winifred Bridge as their family home.</span>\n</p>\n<p>\n<span style=\"font-size:14px;\">Laurie (Laura Perry nee Cheeseman) remembers many happy family gatherings being held at the Lodge around the late 1940's and early 1950's.</span>\n</p>\n</div>\n</div>",
"",
"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThere where many family gatherings at Tipperary. The location was known as Bungalow Town - Shoreham Beach (and Hollywood-By-Sea due to it's reputation for attracting theatrical people). The property was requisitioned by the military defence beginning of WW2 as part of the coastal defence effort against invasion from enemy forces and subsequently  the bungalows were burnt down.\n</p>\n</div>\n</div>",
